import React from "react";
import "./Waves.css";

export const Waves = () => {
  return (
    <section className="waves">
      <div className="wave wave1"></div>
      <div className="wave wave2"></div>
      <div className="wave wave3"></div>
      <div className="wave wave4"></div>
      <div className="wave wave5"></div>
    </section>
  );
};
